import Title from '../../components/Title/Title'
import Text from '../../components/Text/Text'
import Image from '../../components/Image/Image'

const Warranty = ({className, data}) => {
  const {
    title, 
    texts, 
    image
  } = data

  return (
    <section 
      data-name={className}
      className={className ? className : 'warranty'}
    >
        <div className={`${className}__wrapper wrapper`}>
          <div className={`${className}__body`}>
            {title && (
              <Title 
                className={className} 
                title={title}                  
              /> 
            )}
            {texts.length && (
              texts.map(text => 
                <Text 
                  className={className} 
                  text={text} 
                  key={text}                    
                />
              )
            )}                 
          </div>
          <div className={`${className}__image`}>
            {image && (
              <Image 
                dataType={className} 
                image={image}                  
              />
            )}
          </div>
        </div>
      
        <div className={`${className}__wrapper wrapper`}>
          <div className={`${className}__body`}>
            {title && (
              <Title 
                className={className} 
                title={title}                  
              /> 
            )}
            {texts.length && (
              texts.map(text => 
                <Text 
                  className={className} 
                  text={text} 
                  key={text}                    
                />
              )
            )}                 
          </div>
          <div className={`${className}__image`}>
            {image && (
              <Image 
                dataType={className} 
                image={image}                  
              />
            )}
          </div>
        </div>
    </section>
  )
}

export default Warranty
